import React, { Component } from 'react'

export default class WinnersPanel extends Component {
  constructor(props) {
    super(props);
  }
  render(){
    console.log(this.props.userDetail);
    return(
      <div>
        <table>
        <thead><tr><th>Rank</th><th>Winner Address</th><th>Amount</th></tr></thead>
        <tbody>
          {(this.props!==undefined&&this.props.userDetail!==undefined&&this.props.userDetail.winnerArr!==undefined)?
            this.props.userDetail.winnerArr.map((id,index) => (
              <div style={itemBox} key={id}>
                <span>Item#{id}</span><br/>
                <span>Power:{this.props.itemPowers[index]}</span>
              </div>
            )):<tr></tr>
          }
        </tbody>
        </table>
      </div>
    );
  }
}
